import './App.css';
import logo from './Pictures/plogo.png';
import homeScreen from './Pictures/homeScreen.jpg'
import axios from "axios";
import React from "react";
import { useState, useEffect } from "react";
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { Container, Row, Col } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import specialEventParkingImage from "./specialEventParkingImage.jpg"
import golfCartServicesImage from "./specialEventParkingImage.jpg"
import bannerImage from "./Pictures/bannerImage2.jpg"





export function ValetParking() {

    const Banner = () => {
        return (
          <div className="banner">
            <img src={bannerImage} alt="Valet Parking Services" className="banner-image" />
            <div className="banner-text">
              <h1>VALET PARKING SERVICES AND SHUTTLE SOLUTIONS</h1>
              <p>Let us serve you today!</p>
            </div>
          </div>
        );
      };

      const WelcomeSection = () => {
        return (
          <div>
            <div className="header-content">
              <h1>WELCOME TO PENINSULA PARKING</h1>
              <p>At Peninsula Parking, we are dedicated to providing a comprehensive valet service that is tailored to meet the needs of any business or event. Our experienced team of valets has you covered for all of your parking needs, ensuring that your guests can enjoy their visit without worrying about where to park.</p>
            </div>
            <div className="services-grid">
              <div className="service-item">
                <h2>Our VALET SERVICES</h2>
                <p>We offer a range of services, from basic valet parking to more specialized services, such as valet parking for special events. Our team has the experience and expertise to ensure that each and every guest has a safe and enjoyable experience.</p>
              </div>
              <div className="service-item" style={{margin:'2%'}}>
                <h2>Safety & SECURITY</h2>
                <p>At Peninsula Parking, safety and security are our top priorities. We employ a highly trained staff that is committed to providing the highest levels of security and safety for your guests. Our team is experienced in handling a wide range of security situations.</p>
              </div>
            </div>
          </div>
        );
      }





  const Footer = () => {
        return (
          <footer className="footer">
            <Container>
              <Row>
                <Col md={3} sm={6}>
                  <h5>Peninsula Parking</h5>
                  <p><i className="fas fa-phone"></i> 650-508-8886</p>
                </Col>
                <Col md={3} sm={6}>
                  <h5>Services</h5>
                  <ul>
                    <li>Valet Parking</li>
                    <li>Commercial Services</li>
                    <li>Airport Valet Parking</li>
                    {/* Add more services as needed */}
                  </ul>
                </Col>
                <Col md={3} sm={6}>
                  <h5>Company</h5>
                  <ul>
                    <li>Employment</li>
                    <li>Partners</li>
                    <li>About Us</li>
                    <li>Contact Us</li>

                  </ul>
                </Col>
                <Col md={3} sm={6}>
                  <h5>Locations</h5>
                  <ul>
                    <li>Menlo Park Valet Parking Services</li>
                    <li>Palo Alto Valet Parking Services</li>
                    {/* Add more locations as needed */}
                  </ul>
                </Col>
              </Row>
            </Container>
          </footer>
        );
      }


      const NavbarComponent = () => {
        return (
          <nav className="navbar">
            <Container>
              <div className="logo">
                <img style={{ width: '200px', height: '80%' }} src={logo} alt="Logo" />
              </div>
              <ul className="nav-links">
                <li><a href="/valet-parking">Valet Parking</a></li>
                <li><a href="/commercial-services">Commercial Services</a></li>
                <li><a href="/locations">Locations</a></li>
                <li><a href="/Careers">Careers</a></li>
                <li><a href="/about">About</a></li>
                <li><a href="/ContactPage">Contact</a></li>
              </ul>
              <button className="quote-btn" style={{ padding:'13px', color:'black', fontSize:'20px'}}> <a href="Quote" style={{color:'black', textDecoration: 'none'  }}>Request a Quote</a> </button>
            </Container>
          </nav>
        );
      };



return (

    <div>

     {NavbarComponent()}
     <div >
     {Banner()}
     <div>
     {WelcomeSection()}
     </div>
       <div>
       {Footer()}
         </div>
         </div>
         </div>



   );





}
export default ValetParking;
